//src/components/Navbar.js
import React from "react";
import '../App.css';

function Home() {
  return (
    <section id="home" className="home">
      <h2>Professional Nursing Recruiting Agency (PNRA)</h2>
      <p>Bridging the gap in healthcare needs.</p>
    </section>
  );
}

export default Home;
